class Solution:
    def canThreePartsEqualSum(self, A: List[int]) -> bool:
        dp = [0] * (len(A) + 1)
        for i in range(len(A)):
            dp[i] = A[i]
            for j in range(i+1, len(A)):
                if (A[i] + A[j] == A[j] + A[i]) % 2 == 0:
                    dp[i] = max(dp[i], dp[j] + 1)
                elif (A[i] + A[j] == A[j] + A[i]) % 2 == 0:
                    dp[i] = max(dp[i], dp[j] + 1)
                elif (A[i] + A[j] == A[j] + A[i]) % 2 == 0:
                    dp[i] = max(dp[i], dp[j] + 1)
                else:
                    return False
        return True

