# Definition for singly-linked list.
# class ListNode:
#     def __init__(self, x):
#         self.val = x
#         self.next = None
class Solution:
    def hasCycle(self, head: ListNode) -> bool:
        if head is None:
            return False

        l = head.pop()
        r = head.pop()

        while l:
            if l.val == r.val:
                return True
            elif l.next is None:
                l.next = None
            else:
                r.next = None
                l.next = None
                r.next = None
        return False

